}

.main-banner .container {
    position: relative;
    width: 1140px;
    padding-right: 20px;
    padding-left: 20px;
    margin-right: auto;
    margin-left: auto
}

.container-lts {
    position: relative;
    background: white;
    box-sizing: content-box;
    height: 55px;
    padding: 20px 0;
    margin: 0 auto;
    transition: padding .2s, height .2s
}

.main-banner-logo {
    position: relative;
    height: 100%
}

.main-banner-logo>a {
    float: left;
    display: block;
    position: relative;
    height: 100%;
    width: 55px;
    transition: width .2s
}

.main-banner-logo>a:last-child {
    margin-left: 5px
}

.main-banner-logo .cnn-logo {
    position: relative;
    height: 100%!important;
    width: auto;
    transition: height .2s
}

.main-banner-logo .tech-logo {
    position: absolute;
    height: 21px;
    width: 50px;
    top: 50%;
    transform: translateY(-50%)
}

.main-banner .main-nav {
    position: absolute;
    top: 50%;
    right: auto;
    left: 175px;
    transform: translateY(-50%)
}

.main-banner .main-nav-li {
    float: left;
    list-style: none;
    cursor: pointer;
    font-weight: 400
}

.main-banner .main-nav-a {
    position: relative;
    display: inline-block;
    color: #7e7e7e;
    text-decoration: none;
    text-transform: uppercase;
    letter-spacing: 3px;
    font-family: 'SourceSansPro';
    font-size: 14px;
    font-weight: 600;
    margin: 0 20px
}

.main-banner .main-nav-a:after {
    content: '';
    position: absolute;
    bottom: -12px;
    height: 3px;
    width: 0;
    left: 50%;
    background-color: #00bdef;
    transition: width .2s, left .2s
}

.main-banner .main-nav-a:hover,
.main-banner .main-nav-a:focus {
    color: #222
}

.main-banner .main-nav-a:hover:after,
.main-banner .main-nav-a:focus:after {
    left: 0;
    width: 100%
}

